Defendant Jessica J Franz in court with attorney Joseph Smith.  Pablo Galaviz and Kristy Gordon appeared for the State of Wisconsin.
Defendant entered a plea of no contest to count 1 of the Amended Information. Court conducted plea colloquy with defendant. Court found defendant guilty of count 1. Cases 15CF80 and 15CF257 dismissed and read-in.  
The Defendant was sentenced to the following:

IMPOSED AND STAYED SENTENCE OF:   

9 MONTHS JAIL.  CONSECUTIVE WITH CASE 15CF80

TERM OF PROBATION:  18 MONTHS;

CONDITIONS OF PROBATION:  
*AODA Assessment and follow through with any treatment recommended, left to agent's discretion;
*Absolute Sobriety;  Random U.A.'s ; 
*No Use or Possession of alcohol, controlled substances or drug paraphernalia.
*No Use or Possession of prescription drugs without a valid prescription;
*Any valid prescription drugs must be taken only in the manner in which they are prescribed.
*Inform Agent of all prescriptions
*Follow through with any treatment and/or counseling recommended by Agent;
*Defendant to attend a parenting class. 

COURT COSTS:  $243.00 to be paid as a condition of probation;
